import {Tag } from "antd";
export const tableColumns = [
    {
      title: 'Interest',
      width: 70,
      dataIndex: 'name',
      key: 'name',
      sorter: (a, b) => a.name.length - b.name.length,
    },
    {
      title: 'Audience',
      width: 80,
      dataIndex: 'audience_size',
      key: 'audience',
      sorter: (a, b) => a.name.length - b.name.length,
    },
    {
      title: 'Topic',
      dataIndex: 'topic',
      width: 100,
      key: 'topic'
    },
    {
      title: 'Path',
      dataIndex: 'path',
      key: 'path',
      width: 60,
      render: tags => (
        <span>
          {
            tags?tags.map(tag => {
              return (
                <div style={{display: 'inline'}}>
                  <Tag color="magenta" key={tag}>
                  {tag.toUpperCase()}
                  </Tag> 
                </div>

              )
            }):''
          }
        </span>
      )
    },
    {
      title: 'Relevance Score',
      dataIndex: 'relevance',
      width: 100,
      key: 'relevance',
      sorter: (a, b) => a - b
    }
  ]

  export const performanceColumns = [
    {
      title: 'Interest',
      width: 70,
      dataIndex: 'name',
      key: 'name',
      sorter: (a, b) => a.name.length - b.name.length,
    },
    {
      title: 'CPC',
      width: 70,
      dataIndex: 'cpc',
      key: 'cpc',
      sorter: (a, b) => a - b,
    },
    {
      title: 'Clicks',
      width: 70,
      dataIndex: 'clicks',
      key: 'clicks',
      sorter: (a, b) => a - b,
    },
    {
      title: 'Spend',
      width: 70,
      dataIndex: 'spend',
      key: 'spend',
      sorter: (a, b) => a - b,
    },
    {
      title: 'Conversions',
      width: 70,
      dataIndex: 'convertions',
      key: 'convertions',
      sorter: (a, b) => a - b,
    },
  ]

 export const chartData = [
  { country: 'Asia', year: '1750', value: 502,},
  { country: 'Asia', year: '1800', value: 635,},
  { country: 'Europe', year: '1750', value: 163,},
  { country: 'Europe', year: '1800', value: 203,},
]
